import React from "react";

const TodoList: React.FunctionComponent = () => {
    const todos = [{ id: "1", text: "todo1" }];

    return (
        <div className="todoList">
            {todos.map(todo => <li key={todo.id} > {todo.text} </li>)}
        </div>
    );
}

export default TodoList;
